import { Container, ContainerProf } from "./styles";

function ContainerProfile () {
  return (
    <Container>
        <ContainerProf>

          {/* Header Profile */}

          <>
            Header Profile
            <> {/* Header */}
              <img src="https://avatars.githubusercontent.com/u/38590368?v=4"></img>
              <h2>Tayrone</h2>
              <h3>CoderTayrone</h3>
              <a href="#">Edit Profile</a>
            </>
            <> {/* Insights */}
                <span>followers</span>
                <span>following</span>
                <span>stars</span>
              </>

              <> {/* Achievements */}
                <h2>Achievements</h2>
                <img src="https://github.githubassets.com/images/modules/profile/badge--acv-64.png"></img>
              </>
          </>

          {/* Body Profile */}
          <>
            Body Profile
          </>
        </ContainerProf>
    </Container>
  )
}

export default ContainerProfile
